import React from 'react'
import MuiPhoneNumber from 'material-ui-phone-number';

export default function PhoneInput(props) {
    return (
        <MuiPhoneNumber 
            defaultCountry={props.defaultCountry} 
            label={props.label}
            name={props.name}
            value={props.value}
            onChange={props.onChange}
        />
    )
}
